import React, { useState } from 'react';
import './TeeTime.css';

function TeeTime() {
  const [startDate, setStartDate] = useState('');
  const [startTime, setStartTime] = useState('');
  const [reservations] = useState([
    {
      id: 1,
      date: 'Tuesday, May 2',
      time: '10:30 AM'
    },
    {
      id: 2,
      date: 'Friday, May 5',
      time: '2:00 PM'
    },
    {
      id: 3,
      date: 'Sunday, May 7',
      time: '8:00 AM'
    }
  ]);

  const handleManage = (id) => {
    // Handle manage button click
    console.log('Managing reservation:', id);
  };

  return (
    <div className="tee-time-page">
      <h1>Tee Times</h1>
      <p className="subtitle">Find and book your tee times</p>

      <section className="reservations-section">
        <h2>My Reservations</h2>
        <div className="reservations-list">
          {reservations.map((reservation) => (
            <div key={reservation.id} className="reservation-item">
              <span className="reservation-datetime">
                {`${reservation.date} - ${reservation.time}`}
              </span>
              <button 
                className="manage-button"
                onClick={() => handleManage(reservation.id)}
              >
                Manage
              </button>
            </div>
          ))}
        </div>
      </section>

      <section className="search-section">
        <h2>Search for a Tee Time</h2>
        <div className="search-form">
          <div className="form-group">
            <label>Start Date</label>
            <input
              type="date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
              placeholder="mm/dd/yyyy"
            />
          </div>
          <div className="form-group">
            <label>Start Time</label>
            <input
              type="time"
              value={startTime}
              onChange={(e) => setStartTime(e.target.value)}
              placeholder="--:-- --"
            />
          </div>
        </div>
      </section>
    </div>
  );
}

export default TeeTime;
